INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "キャル", 0, -363.0, 7, 0.0, 1, 0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 106001, 7001, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "コッコロ", 0, -363.0, 7, 0.0, 1, 0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 105901, 7002, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "ペコリーヌ", 0, -363.0, 7, 0.0, 1, 0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 105801, 7003, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "ペコリーヌ", 0, -363.0, 10, 0.0, 1, 0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 105801, 10001, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "キャル", 0, -363.0, 10, 0.0, 1, 0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 106001, 10002, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "コッコロ", 0, -363.0, 10, 0.0, 1, 0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 105901, 10003, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "シェフィ", 2104010, -363.0, 10, 0.0, 2, 0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 106401, 10004, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "ペコリーヌ", 0, -416.5, 12, 0.0, 1, 0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 105801, 12001, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "キャル", 0, -363.0, 13, 0.0, 1, 0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 106001, 13001, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "コッコロ", 0, -363.0, 13, 0.0, 1, 0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 105901, 13002, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "シェフィ", 2104010, -363.0, 13, 0.0, 2, 0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 106401, 13003, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "ペコリーヌ", 0, -363.0, 13, 0.0, 1, 0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 105801, 13004, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "コッコロ", 0, -363.0, 14, 0.0, 1, 0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 105901, 14001, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "シェフィ", 2104010, -363.0, 14, 0.0, 2, 0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 106401, 14002, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "ペコリーヌ", 0, -363.0, 14, 0.0, 1, 0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 105801, 14003, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "キャル", 0, -363.0, 14, 0.0, 1, 0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 106001, 14004, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "コッコロ", 0, -470.0, 15, 0.0, 1, 0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 105901, 15001, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "シェフィ", 2104010, -363.0, 16, 0.0, 2, 0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 106401, 16001, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "ペコリーヌ", 0, -363.0, 16, 0.0, 1, 0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 105801, 16002, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "キャル", 0, -363.0, 16, 0.0, 1, 0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 106001, 16003, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "コッコロ", 0, -363.0, 16, 0.0, 1, 0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 105901, 16004, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "コッコロ", 0, -363.0, 17, 0.0, 1, 0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 105901, 17002, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "キャル", 0, -363.0, 25, 0.0, 1, 0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 106001, 17004, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "コッコロ", 0, -363.0, 25, 0.0, 1, 0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 105901, 17005, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "シェフィ", 2104010, -363.0, 25, 0.0, 2, 0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 106401, 17006, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "ペコリーヌ", 0, -363.0, 25, 0.0, 1, 0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 105801, 17007, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "カリン", 0, -363.0, 18, 0.0, 1, 0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 190801, 18001, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 2, "カリン", 0, -363.0, 18, 0.0, 1, 0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 190801, 18002, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 3, "カリン", 0, -470.0, 19, 0.0, 1, 0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 190801, 19001, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 4, "カリン", 0, -470.0, 19, 0.0, 1, 0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 190801, 19002, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 5, "カリン", 0, -470.0, 20, 0.0, 1, 0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 190801, 20001, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 6, "カリン", 0, -470.0, 20, 0.0, 1, 0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 190801, 20002, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "キャル", 0, -363.0, 21, 0.0, 1, 0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 106001, 21001, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "コッコロ", 0, -363.0, 21, 0.0, 1, 0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 105901, 21002, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "シェフィ", 2104010, -363.0, 21, 0.0, 2, 0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 106401, 21003, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "ペコリーヌ", 0, -363.0, 21, 0.0, 1, 0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 105801, 21004, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 1, "カリン", 0, -430.0, 22, 0.0, 1, 0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 190801, 22001, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 2, "カリン", 0, -430.0, 22, 0.0, 1, 0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 190801, 22002, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 3, "カリン", 0, -430.0, 23, 0.0, 1, 0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 190801, 23001, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2015/12/17 15:00:00", 4, "カリン", 0, -430.0, 23, 0.0, 1, 0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 190801, 23002, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 1, "エリコ（バレンタイン）", 0, -385.0, 24, 4.08, 1, 10011, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 109001, 24001, 2, 8.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 2, "エリコ（バレンタイン）", 0, -385.0, 24, 5.0, 1, 10011, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 109001, 24002, 2, 8.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 3, "エリコ（バレンタイン）", 0, -385.0, 24, 10.11, 1, 10011, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 109001, 24003, 2, 8.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 4, "エリコ（バレンタイン）", 0, -385.0, 24, 4.0, 1, 10011, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 109001, 24004, 2, 8.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 5, "エリコ（バレンタイン）", 0, -385.0, 24, 6.0, 1, 10011, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 109001, 24005, 2, 8.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 6, "エリコ（バレンタイン）", 0, 0.0, 24, 0.0, 1, 10011, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 109002, 24006, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 7, "エリコ（バレンタイン）", 0, 0.0, 24, 0.0, 1, 10011, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 109002, 24007, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 8, "エリコ（バレンタイン）", 0, 0.0, 24, 0.0, 1, 10011, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 109002, 24008, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 9, "エリコ（バレンタイン）", 0, 0.0, 24, 0.0, 1, 10011, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 109002, 24009, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 10, "エリコ（バレンタイン）", 0, 0.0, 24, 0.0, 1, 10011, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 109002, 24010, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 1, "シズル（バレンタイン）", 0, -385.0, 24, 2.12, 1, 10011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 109101, 24011, 2, 8.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 2, "シズル（バレンタイン）", 0, -385.0, 24, 4.19, 5, 10011, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 109101, 24012, 2, 8.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 3, "シズル（バレンタイン）", 0, -385.0, 24, 2.3, 2, 10011, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 109101, 24013, 4, 8.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 4, "シズル（バレンタイン）", 0, 0.0, 24, 0.0, 1, 10011, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 109102, 24014, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 5, "シズル（バレンタイン）", 0, -385.0, 24, 5.23, 5, 10011, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 109101, 24015, 2, 8.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 6, "シズル（バレンタイン）", 0, 0.0, 24, 0.0, 1, 10011, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 109102, 24016, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 7, "シズル（バレンタイン）", 0, -385.0, 24, 5.01, 1, 10011, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 109101, 24017, 2, 8.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 8, "シズル（バレンタイン）", 0, 0.0, 24, 0.0, 1, 10011, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 109102, 24018, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 9, "シズル（バレンタイン）", 0, 0.0, 24, 0.0, 1, 10011, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 109102, 24019, 1, 0.0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("2030/12/17 14:59:59", "2019/01/31 12:00:00", 10, "シズル（バレンタイン）", 0, 0.0, 24, 0.0, 1, 10011, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 109102, 24020, 1, 0.0);
